import React, { Component } from 'react';
import logo from './zba.svg';
import "./App.css"

class Home extends Component {
  constructor() {
    super(props)
    this.state = {
      recipe:'',
      beer:'',
      malt:'',
      creator:''
    }
  }

  onSubmit(e) {
     e.preventDefault();
  }

  render() {
    const { recipe, beer, malt, creator } = this.state
    return (
    	<div className="App-in Font">
	    	<header className="App-header">
          		<img src={logo} className="Zba-logo" alt="logo" />
	    	</header>
        <form className="Div" onSubmit={this.onSubmit}>
          <label>Recipe</label>
          <br/><br/>
          <input type="text" name="recipe" value={recipe}/>
          <br/><br/>
          <label>Type of beer</label>
          <br/><br/>
          <input type="text" name="beer" value={beer}/>
          <br/><br/>
          <label>Type of malt</label>
          <br/><br/>
          <input type="text" name="malt" value={malt}/>
          <br/><br/>
          <label>Creator name</label>
          <br/><br/>
          <input type="text" name="creator" value={creator}/>
          <br/><br/>
          <button>Add new recipe</button>
          <br/><br/>
        </form>
    	</div>
    )
  }
}

export default Home;
